import React from 'react';
import { BrowserRouter as Router, Routes, Route, NavLink } from 'react-router-dom';
import './App.css';

// Sidebar Component
function Sidebar() {
  return (
    <div className="sidebar">
      <h2>My Profile</h2>
      <nav>
        <NavLink to="/" end className={({ isActive }) => (isActive ? 'active' : '')}>
          Home
        </NavLink>
        <NavLink to="/projects" className={({ isActive }) => (isActive ? 'active' : '')}>
          Projects
        </NavLink>
        <NavLink to="/about" className={({ isActive }) => (isActive ? 'active' : '')}>
          About
        </NavLink>
        <NavLink to="/contact" className={({ isActive }) => (isActive ? 'active' : '')}>
          Contact
        </NavLink>
      </nav>
    </div>
  );
}

// Home page with Download Resume button
function Home() {
  const downloadResume = () => {
    fetch('http://localhost:5000/download-resume')
      .then(res => {
        if (!res.ok) throw new Error('Network response was not ok');
        return res.blob();
      })
      .then(blob => {
        const url = window.URL.createObjectURL(blob);
        const a = document.createElement('a');
        a.href = url;
        a.download = 'resume.pdf'; // Filename for the downloaded file
        document.body.appendChild(a);
        a.click();
        a.remove();
        window.URL.revokeObjectURL(url);
      })
      .catch(err => {
        alert('Failed to download resume: ' + err.message);
      });
  };

  return (
    <div className="page-content">
      <h1>Home</h1>
      <p>Welcome to my profile!</p>
      <button onClick={downloadResume}>Download Resume PDF</button>
    </div>
  );
}

function Projects() {
  return (
    <div className="page-content">
      <h1>Projects</h1>
      <p>Here are some of my projects.</p>
    </div>
  );
}

function About() {
  return (
    <div className="page-content">
      <h1>About</h1>
      <p>About me section content.</p>
    </div>
  );
}

function Contact() {
  return (
    <div className="page-content">
      <h1>Contact</h1>
      <p>Contact me at email@example.com.</p>
    </div>
  );
}

// Main App
function App() {
  return (
    <Router>
      <div className="app-container">
        <Sidebar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/projects" element={<Projects />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
